export default function fetchStockData(ticker){


var price = Math.floor(Math.random() * 11);
var open = Math.floor(Math.random() * 11);
var close = Math.floor(Math.random() * 11);

    let data = {"Symbol":ticker,"price":price,"open":open,"close":close};

